import React from 'react';
import { AppBar, Toolbar, Button, Box } from '@mui/material';
import { styled } from '@mui/system';
import SearchIcon from '@mui/icons-material/Search';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import ShoppingBagOutlinedIcon from '@mui/icons-material/ShoppingBagOutlined';
import baaMbooLogo from '../assets/mainlogo1.png';

const StyledAppBar = styled(AppBar)({
  backgroundColor: '#ffffff', // White background to match the image
  boxShadow: '0 1px 0 rgba(0, 0, 0, 0.1)', // Subtle bottom border
});

const StyledButton = styled(Button)({
  color: '#000000', // Black text to match the image
  padding: '8px 16px',
  fontWeight: 500,
  textTransform: 'uppercase', // Uppercase text like in the image
  fontSize: '0.75rem', // Smaller font size
  '&:hover': {
    color: '#28b463', // Keep your green hover color
    backgroundColor: 'transparent',
  },
  '&:after': {
    content: '""',
    position: 'absolute',
    width: '0',
    height: '1px',
    bottom: '0',
    left: '50%',
    backgroundColor: '#28b463',
    transition: 'width 0.3s ease, left 0.3s ease',
  },
  '&:hover:after': {
    width: '100%',
    left: '0',
  },
});

const IconButton = styled(Button)({
  color: '#000000',
  padding: '8px',
  minWidth: 'auto',
  '&:hover': {
    color: '#28b463',
    backgroundColor: 'transparent',
  },
});

const LogoImage = styled('img')({
  height: '40px',
  width: '',
  cursor: 'pointer',
});

const PageContainer = styled(Box)({
  maxWidth: '1440px',
  width: '100%',
  margin: '0 auto',
  padding: { xs: '0 15px', sm: '0 20px' },
});

const Navbar = () => {
  return (
    <StyledAppBar position="static">
      <PageContainer>
        <Toolbar sx={{ justifyContent: 'space-between', alignItems: 'center', minHeight: '60px' }}>
          {/* Logo on the left */}
          <Box>
            <a href="#home" style={{ textDecoration: 'none' }}>
              <LogoImage src={baaMbooLogo} alt="Baa M Boo Logo" />
            </a>
          </Box>

          {/* Navigation Links in the center */}
          <Box sx={{ flexGrow: 1, display: 'flex', justifyContent: 'center', gap: '20px' }}>
            <StyledButton href="#men">Men</StyledButton>
            <StyledButton href="#women">Women</StyledButton>
            <StyledButton href="#kids-baby">Kids & Baby</StyledButton>
            <StyledButton href="#home">Home</StyledButton>
            <StyledButton href="#gifts">Gifts</StyledButton>
            <StyledButton href="#discover">Discover</StyledButton>
            <StyledButton href="#sale">Sale</StyledButton>
          </Box>

          {/* Icons on the right */}
          <Box sx={{ display: 'flex', gap: '10px' }}>
            <IconButton href="#search">
              <SearchIcon sx={{ fontSize: '20px' }} />
            </IconButton>
            <IconButton href="#account">
              <PersonOutlineIcon sx={{ fontSize: '20px' }} />
            </IconButton>
            <IconButton href="#wishlist">
              <FavoriteBorderIcon sx={{ fontSize: '20px' }} />
            </IconButton>
            <IconButton href="#cart">
              <ShoppingBagOutlinedIcon sx={{ fontSize: '20px' }} />
            </IconButton>
          </Box>
        </Toolbar>
      </PageContainer>
    </StyledAppBar>
  );
};

export default Navbar;
